import React from "react";

import { BrowserRouter as Router, Switch, Route } from "react-router-dom";
import IndexEasy from "./IndexEasy";

function App() {
  return (
    <Router>
      <Switch>
        <Route
          exact
          path="/catalogue%20form1.html"
          render={(e) => <IndexEasy />}
        />
        <Route exact path="/" render={(e) => <IndexEasy />} />
      </Switch>
    </Router>
  );
}

export default App;
